export default function Layout() {
  return (
    <div className="card-main w-[400px] h-[300px] bg-[var(--dark-blue)] rounded-2xl flex flex-col p-6">
      <div className="card-head"></div>
      <div className="card-body"></div>
      <span className="fav-icon w-[40px] h-[40px] flex flex-row items-center justify-center rounded-full bg-[var(--light-blue-bg)]">
        <img src={require("../images/icon-star.svg").default}></img>
      </span>
      <h3 className="text-2xl font-semibold">How did we do?</h3>
      <p className="text-[var(--light-grey)] pr-16">
        Please let us know how we did with your support request. All feedback is
        appreciated to help us improve our offering!
      </p>
      <div className="rate-buttons flex flex-row items-center justify-between gap-x-5">
        {[1, 2, 3, 4, 5].map((btn) => (
          <button
            className="text-[var(--medium-grey)] w-[50px] h-[50px] flex flex-row items-center justify-center rounded-full bg-[var(--light-blue-bg)]"
            key={btn}
          >
            {btn}
          </button>
        ))}
      </div>
      <button className="submit-button bg-[var(--orange)] p-3 rounded-2xl w-[100%]">
        SUBMIT
      </button>
    </div>
  );
}
